"title": "Lumpy Blue Tea cup, Wine cup, Whiskey glass, Wine glass Porcelain Ceramic Pottery",
"description": "3&quot; x 3.5&quot;\nHolds 12oz of your drink of choice.\n\nThese porcelain cups are thrown, trimmed, and fired to cone six in an electric kiln. During the throwing process I alter the form by denting and stretching the surface creating areas for your fingers to rest nicely. This particular blue/turquoise is a combination of three glazes that create a subtle variation throughout the cups surface.\n\nThe glazes on these cups are exceptional and of the quality I would submit to a gallery. The small speckles you see are micro crystals caused by the cooling cycle I program into my electric kiln creating a very smooth and matte surface. I hope that these cups are as much of a joy for you to use as they are to look at.\n\nAll of my pots are dishwasher and microwave safe. The glazes I use are 100% food safe and lead free. Everything is entirely handmade by me in my studio in Southern California.",
