"description": "This listing is for ONE flask with a black pouch, personalized with the above engraving design.\n\nDesigned to carry liquor, our 6 ounce black, powder coated flask is made of stainless steel. Our state-of-the-art laser engraves the black powder coating resulting in a permanent, beautiful silver engraving, which shines in any light! \n\nSPECIFICATIONS:\n3-5/8&quot; wide x 4-5/16&quot; tall (including neck and cap);\nFood grade stainless steel;\nProfessionally powder coated;\nDurable and long lasting. \n\nPERSONALIZATION:\nThe front side of the flask will be personalized with your choice of an engraving design as shown in the above photos.\n\nORDERING:\nSelect the quantity and engraving design option from the drop-down menus, and specify all engraving information in the note box on the &#39;add to cart&#39; page, including the following information if applicable:\n1) Name;\n2) Title;\n3) Wedding date.\n\nFor other engraving designs select the following link:\nhttps://www.etsy.com/shop/EngravingPro?section\n\nMost orders are ready and shipped within 5 business days after receiving payment.\n\nINTERNATIONAL orders are WELCOME! \n\nThank you for visiting our shop!\n* * * * * * * * * * * * * * * * * * * *  \nReview our shop policies here:\nhttp://www.etsy.com/shop/EngravingPro/policy",
