"title": "Â® Got Whiskey?  Registred Trademark",
"announcement": "WELCOME TO &quot;GOT WHISKEY?&quot;  your place for unique whiskey inspired hand crafted, hand made, items.\r\nProud to be the ORIGINAL Liquor Flavored Organic Chap stick Seller here on Etsy...The FIRST to be made and sold, working hard to create a unique item that no one else has...be assured Got Whiskey is the first to create unique custom Liquor inspired items here on Etsy.  With Got Whiskey being now a Registered TRADEMARKED LOGO/LINE...I aim to make a name for myself and to date..am succeeding.\r\n\r\nGot Whiskey sells wholesale...please convo  with questions!\r\n\r\nHow the name Got Whiskey Came to be....\r\nReading through a old vintage book there was a description of a &quot;Lady&quot; in a Saloon sitting watching for her next quest for the evening as she was sipping on a glass of Whiskey and what she left behind..Red Lipstick on her glass as she took her last shot before she made her move.&quot;\r\nAnd well thats the rest of the story.......\r\n Long range goal is to create a womens whiskey, one the ladies will LOVE..of course the name? You got it..&quot;Lipstick Whiskey&quot; the Mother company of Got Whiskey...Keep an eye out for it..coming your way soon..\r\n\r\nYou might recognize the name LipStick Whiskey? If you do, YEP....thats us, although recently Dawnette has taken over the Vintage clothing line as I bought her out of Got Whiskey..You can still find her vintage clothing line, only now its called.\r\nwww.urbanvintagecowgirl.etsy.com\r\n",
