"title": "Unique industrial hillbilly table lamp made from an 1940 electrical circuit breaker box and a filter from a whiskey still with Ipe base/stem",
"description": "This one of a kind table lamp is fashioned from a weathered and aged 1940 Taylor Electric Mfg Co. circuit breaker box ( it says London & Canada on the brass label plate) with African mahogany (Ipe), and an old flex filter from a whiskey still. The classic font and cool look of the 1930s and 1940s exists on this electrical box. The flexi  goose neck of the filter makes a fun upper half of the lamp. It&#39;s an homage to times past using all reclaimed parts. The lamp stands 25&quot; tall and the base is 6&quot; x 8&quot;. The toggle switch on the box operates the lamp. SalvageConstruct plans to produce many more fun historical art furniture, so please keep an eye out for us. Thanks for taking the time to look at my pieces and have a great day. If you have any questions feel free to send me an email. I have several more pieces coming soon so keep checking in. Thanks for the support.",
