"description": "Whiskey By The Fire Bottle Cap Balm Scent Sampler\r\n\r\nWhiskey By The Fire Smells Like:\r\nGreen moss, foliage, with warm masculine spice. Very popular scent!\r\n------------------------\r\n\r\nIf you feel like your beard is a bit out of control, tame it down with American Gentleman Beard Balm! These bottle cap samplers are great if you are new to American Gentleman, or if you are unsure of which scent you want to buy. These samplers are made in bottle caps, with enough balm to use a few times depending on the length of your beard.\r\nAmerican Gentleman Beard Balm has a waxy texture that will help you gain control of your whiskers and allow you to shape your beard to your liking. Moisturizing oils & butters in the beard balm will also soften your facial hair and smooth out the rough texture. Beard balm works best for guys with longer beards.\r\n--------------------------\r\nHow to Use Beard Balm:\r\n1. Scrape a small amount out of the tin with your finger\r\n2. Warm the balm in your palms by rubbing them together\r\n3. Work the balm into your beard, starting at the ends and working your way up to your chin and neck\r\n4. Smooth and shape your beard to your liking\r\nThe beeswax in the balm will help keep those wiry hairs in place while the oils soften and condition your beard and skin!\r\n--------------------------\r\nThis Product Contains: Beeswax, Grape Seed Oil, Shea Butter, Fragrance Oil, Coconut Oil, Sweet Almond Oil, Extra Virgin Olive Oil, & Jojoba Oil\r\n\r\nIf you have an allergy to any of these ingredients DO NOT USE. If you have questions about any of the ingredients this product contains, please do not hesitate to ask.",
