"announcement": "Hip flasks are the perfect gift for a stocking stuffer, wedding, bridal party, bachelorette party, birthday present, retirement, new years, sorority, secret santa, employees or for yourself.\r\n\r\nFlask designs are printed on premium quality vinyl decal and laminated with a clear, professional grad PVC for extra durability and protection. Available for purchase in 4 special finishes. Choose from embossed antique leather, embossed cloth, smooth glossy sparkle or matte. See flask product descriptions for more information.\r\n\r\nStainless steel 6oz hip flask by Lady Rene\r\nâ˜… Hip & Stylish Gift for under $25\r\nâ˜… Fits conveniently in purse or pocket\r\nâ˜… Durable, water and fade resistant.\r\nâ˜… Personalize Flask No Extra Fee (see product listing for details)\r\nâ˜… Order as many flasks as you want for only $5.95 shipping (USA only)\r\nâ˜… Add a funnel to your order! Click Here - https://www.etsy.com/listing/78180589/stainless-steel-flask-funnel-with-ball?ref=shop_home_feat_1\r\n\r\n\r\nTake a look and support these wonderful shops that sell Lady Rene flasks!\r\nSupport local businesses!!\r\n- Paperish Mess: paperishmess.com\r\n- Co-op 28 Handmade: Los Angeles www.facebook.com/Coop28handmadeâ€Ž\r\n- Sacred Art - Chicago: \r\nhttp://www.facebook.com/SacredArtChicago â€¢ www.sacredartstore.com\r\n- Re-Invent - Chicago: https://www.facebook.com/ReInventstudio",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for ordering!!!!  \r\n\r\nAll flasks are &quot;Made to Order&quot;. You will receive a shipping notification by email when your package leaves for the postal service. Have a concern, question or request? Please contact Miranda right away at mirandarowe@ladyrene.com or through the website.\r\n\r\nâ˜…â˜…â˜… Please check the homepage for special shop announcements! \r\n\r\nâ˜…â˜…â˜… Orders process in 3-5 business days (Mon - Fri)  (Shipping time additional). Please note that holiday rush may extend the processing time. If you have a rush order please put your deadline in the note box and we will do our best to get your order out as quickly as possible.\r\n\r\nâ˜…â˜…â˜… USA SHIPMENTS: Your flask order may ship by either USPS Priority Mail (2-3 business days) or First Class (continental U.S. 2-5 days for delivery).\r\n\r\nâ˜…â˜…â˜… INTERNATIONAL SHIPMENTS: Please allow 3 or more weeks for delivery. In some instances your package may arrive quicker within 10 or more business days depending on destination. Package will be shipped by First Class Mail International. Please allow adequate shipping time for your order to arrive. We cannot guarantee arrival by a specific time. Customs may cause significant delays. Any customs fees are the responsibility of the customer.\r\n\r\nâ˜…â˜…â˜… If you have made special arrangements with us concerning your order, please know that your order will ship in a timely manner as agreed upon. \r\n\r\nâ˜…â˜…â˜… Express shipping is available by request for an additional fee.",
