"policy_refunds": "RETURNS:\r\nIf you are unhappy for any reason, notify Lady Rene and we will gladly exchange or refund your money less any delivery charges.\r\n\r\nâ€¢ Custom Order: Items are FINAL SALE, and we will only accept returns on special orders in the event of a mistake on our part or damage to the product.\r\n\r\nDAMAGED SHIPMENT:\r\nDamaged merchandise may be returned for a replacement. You may be required to return the item or take photos of the damage. In the event that a replacement is not available the purchase price will be refunded. Please send email with your name, order # and a brief description of the damaged item or items being returned. Return shipping is nonrefundable.",
