"description": "About the Whiskey Barrel:\n\nPersonalize this whiskey barrel with a custom logo (Buyer is responsible for creating and providing this), initials or 2 lines of text.  \n\nAge your own with our Personalized Whiskey Barrel. The steel-banded oak barrel can be used for aging or serving your favorite wine or liquor.\n\n    Kegs are charred on the inside to medium+\n    Made from american white oak\n    Includes stand, spigot and bung\n    Black hoops\n\n1 Liter Barrel Measurements:  Measures 4.5&quot; diameter and 6&quot; long\n2 Liter Barrel Measurements:  Measures 5&quot; in diameter and 7.5&quot; long \n3 Liter Barrel Measurements:  Measures 8.5&quot; long and 6&quot; in diameter  \n5 Liter Barrel Measurements:  Measures 10&quot; long and 7&quot; in diameter \n\n*****Whiskey Barrel will arrive uncured.  The curing process smoothâ€™s out the barrel and causes the wood to swell and fill in any imperfections. The steel rings may also fit a little loose upon arrival so that when the wood expands the rings will fit snugly.   Curing instructions are included.\n\n\n\n\nOrder in 3 easy steps!  \n\n1. Choose quantity, engraving option.\n2. Leave engraving instructions in the &quot;Notes to Seller&quot; section at check out.\n3. Pay with credit card or paypal!\n\n\n\n\n\nEngraving Options:\n\nCustom Logo:  If you have a custom wedding or Compay logo that you would like engraved, this is the option for you.  Please send logo to jacobknopke@gmail.com.\n\nInitials:  Choose up to 5 initials to have laser engraved.\n\n1 Line:  The Whiskey Barrel will be engraved with up to 10 Characters of your choice.\n \n2 Lines: 2 lines of up to 10 characters each.\n\n\n**** Leave the engraving instructions in the &quot;notes to seller&quot; section at check out ****\n\nShipping Note:\n\n*Please review shipping policy prior to purchase.  If rush shipping is required please contact me  confirm availability.",
